import { Flex, Text, Center, Image } from "@chakra-ui/react";
import logo from '../logo.png'

export const Header = () => {
  return (
    <Flex color='white' justifyContent='center' boxShadow='base'>

        <Image src={logo} boxSize='250px' alt='Dan Abramov' />

    </Flex>

  )
}
